import "../App.css";
import Master from "./Master";

const Header = () => {
  return (
    <div className="header">
      <div className="sub-header">
        <div className="info">
          <span>Header/info</span>
          <div className="display">
            <span>Info display</span>
          </div>
        </div>
        <div className="inst-sect">
          <div>1</div>
          <div>2</div>
          <div>3</div>
          <div>4</div>
          <div>5</div>
        </div>
      </div>
      <Master />
    </div>
  );
};
export default Header;
